import {useSelector} from 'react-redux'
export default function JewelsTable(){
    const jewels = useSelector((state)=>{
        return state.jewels
      })
    
    return(
        <div>
            <table>
                <thead>
                    <tr>
                        <th>images</th>
                        <th>price</th>
                        <th>caption</th>
                    </tr>
                </thead>
                <tbody>
                    {}
                </tbody>
            </table>
        </div>
    )
}
